import React from "react";

export const About = () => {
    return (
        <div className="container my-5" style={ { backgroundColor: "lightcyan"} }>
            <h6>
            This is a Todo app, where you can put title and description of your daily todo task and it will be added in your todo list.
            <br/>
            You can delete it when the task is done. It is a reactJs based app. Hope you like it.
            </h6>
        </div>
    )
}
